import re
import os
import sys
import json
import time
import shutil
import requests
import datetime
from bs4 import BeautifulSoup
from argparse import ArgumentParser


def scrape(link, get_link=False):
	try:
		r = requests.post(link).content
		r = r.decode("utf-8")
	except UnicodeDecodeError:
		print("!!! UnicodeDecodeError")
		return (None, None, None, None)
	except:
		print("!!! Unexpected error:", sys.exc_info()[0])
		time.sleep(5)
		scrape(link, get_link)

	if "404 Error" in r or "抱歉，您访问的页面不存在！" in r:
		print("!!! 404 Error")
		return (None, None, None, None)

	r = re.sub("[\r\t\f\v\n]", "", r)
	r = re.sub("<[ /]*?(br|BR)[^>]*?[ /]*?>", "\n", r)
	r = re.sub("<[ /]*?(em|EM)[ /]*?>", "", r)
	r = re.sub("<[ /]*?(b|B)[ /]*?>", "", r)
	r = re.sub("<[ /]*?(i|I)[ /]*?>", "", r)
	r = re.sub("<[ /]*?(strong|STRONG)[ /]*?>", "", r)
	r = re.sub("<[ /]*?(center|CENTER)[ /]*?>", "", r)
	r = re.sub("<[ /]*?(img|IMG)[^>]*?[ /]*?>", "\n", r)
	r = re.sub("<script>[^<>]*?</script>", "", r)
	r = re.sub("<o\:", "<", r)
	r = re.sub("</o\:", "</", r)
	r = re.sub("<p></p>", "", r)
	r = re.sub("<sup/?>", "", r)
	r = re.sub("<sub/?>", "", r)
	r = re.sub("&nbsp;", " ", r)
	r = re.sub(" +", " ", r)
	r = re.sub("\u200b|\u3000|\ufeff|\u00a0|\u007f", "", r)
	r = re.sub("<!--([\w\W]*?)-->", "", r)

	date = re.search("20\\d\\d\-[0-1]\\d\-[0-3]\\d", r).group(0)

	paragraphs = []
	page = BeautifulSoup(r.encode("utf-8"), "html.parser")
	if title := page.find("div", {"class": "art-title"}):
		title = title.get_text()

	content = page.find("div", {"class": "art-con-bottonmLine"})

	zh_link = None
	if get_link:
		if hyperlinks := content.find_all("a"):
			for hyperlink in hyperlinks:
				if re.search("\/\\d{6}\/(\\d{14})\.s?html", hyperlink["href"]):
					zh_link = hyperlink["href"]
		if not zh_link or zh_link.startswith("http://tzswj"):
			print("!!! No chinese link for " + link)
			return (None, None, None, None)

	if content:
		try:
			children = []
			for c in content.find_all(text=True, recursive=False):
				children.extend(c.split("\n"))
			children = [c.strip() for c in children if c.strip()]
			# if children:
			# 	print(children)
		except:
			children = []
		for child in content.findChildren():
			if len(child.find_all("p")) in [0,1] and child.name != "span" and child.name != "a" and child.name != "font":
				if child.findChildren() == []:
					children.extend(child.get_text().split("\n"))
				elif child.find("a"):
					children.extend(child.get_text().split("\n"))
				else:
					spans = ""
					for span in child.find_all("span"):
						spans += span.get_text()
					if len(child.get_text()) > len(spans):
						children.append(child.get_text())
					else:
						children.append(spans)
	else:
		print("!!! Weird format for " + link)
		return (None, None, None, None)

	paragraphs = []
	for p in children:
		if p.strip() not in paragraphs and ("All information published in this website is authentic" not in p.strip() and "English is provided for reference only" not in p.strip()) and p.strip() and "图片来源" not in p.strip() and "Translated by" not in p.strip() and not p.strip().startswith("附件：") and not p.strip().startswith("Attachment:") and not p.strip().startswith("Photo by") and not p.strip().startswith("数据来源：") and not p.strip().startswith("网站:") and not p.strip().startswith("Website") and not p.strip().startswith("Contact information:") and not p.strip().startswith("Tel:") and not p.strip().startswith("E-Mail:") and not p.strip().startswith("联系方式："):
			paragraphs.append(p.strip())

	if len(paragraphs) > 4:
		if paragraphs[-4] == "关闭生产资料动态" and paragraphs[-3] == "关闭全国农产品商务信息公共服务平台" and paragraphs[-2] == "农产品贸易专题" and paragraphs[-1] == "全国农产品流通体系建设管理信息平台":
			paragraphs.pop()
			paragraphs.pop()
			paragraphs.pop()
			paragraphs.pop()

	return (paragraphs, title, date, zh_link)


